const Titre = ({ bgcolor, color }) => (
  <h1 style={{ backgroundColor: bgcolor, color: color }}>Photos</h1>
);

export class Photos extends Component {
  render() {
    return (
      <div style={{ marginTop: '100px' }}>
        <Titre bgcolor='rgba(255,255,255,0.1)' />
      </div>
    );
  }
}

export default Photos;
